import React from 'react';

const CreationSingle = ({ backgroundColor, color, quote, sausage }) => {
    return (
        <div style={{
            backgroundColor: backgroundColor,
            borderRadius: "10px",
            padding: "20px",
            display: "inline-block",
            textAlign: "center"
        }}>
            <BigDialogue quote={quote} color={color} />
            <BigCorgi color={color} sausage={sausage} />
        </div>
    )
}

export default CreationSingle

const BigDialogue = ({ quote, color }) => {
    return (
        <div style={{
            position: "relative",
            width: "300px",
            padding: "3px",
            wordWrap: "break-word",
            backgroundColor: "white",
            opacity: "0.7",
            borderRadius: "20px",
            left: "160px"
        }}>
            <p style={{ color: color, margin: "0" }}><i class="fa fa-quote-left"></i>{quote}</p>
        </div>
    )
}

const BigCorgi = ({ color, sausage }) => {
    return (
        <div style={{ display: "flex" }}>
            <div style={{ margin: "0" }}>
                <Head color={color} />
            </div>
            <div style={{ margin: "0", position: "relative", bottom: "-131px", left: "-1px" }}>
                <Body color={color} sausage={sausage} />
            </div>
            <div style={{ margin: "0", position: "relative", bottom: "-18px", left: "-1px" }}>
                <Tail color={color} />
            </div>
        </div>

    )
}

